import 'bootstrap/dist/css/bootstrap.min.css';
import "../css/head.css";
import useUser from '../components/useUser';
import logo from "../Content/logo.svg";
import axios from 'axios';
import React, { useState, useEffect } from 'react';
const Header = () => {
    function parseJwt (token) {
        const base64Url = token.split('.')[1];
        const base64 = base64Url.replace(/-/g, '+').replace(/_/g, '/');
        const jsonPayload = decodeURIComponent(window.atob(base64).split('').map(function(c) {
            return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
        }).join(''));

        return JSON.parse(jsonPayload);
    }



  //const isLogged=false;
  const [isOpen, setIsOpen] = useState(false);
  let isLogged;

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };
  const [usuariosList, setUsuarios] = useState([]);

    useEffect(() => {
        const val = async () => {
          try {
            const response = await axios.get('http://localhost:3001/usuarios');
            const nombre = localStorage.getItem("Nombre");
            const data = response.data;
            const user = data.find(user => user.Nombre === nombre);
            setUsuarios(user);
            isLogged= (parseJwt(localStorage.getItem('token')).exp * 1000 > Date.now());
          } catch (error) {
            console.error(error);
          }
        };

        val(); 


      }, []);
  const handleLogout = () => {
      // Llama a la función logout del hook useUser para cerrar la sesión y borrar el valor del localStorage
  };
  return (
    <header id="header " class="fixed-top bg-white shadow-lg"style={{ marginBottom: '20px' }}>
      <div class="bg-azulO ">
